import React from "react";
import styled from "styled-components";

let Section = styled.section`
	margin-top: 100px;
	width: 80%;
`;

let Title = styled.h1``;

function Jumbotron() {
	return (
		<Section>
			<Title></Title>
		</Section>
	);
}

export default Jumbotron;
